import React from "react";
import componentStyle from "./index.module.css";

export default class WireTypeChoosing extends React.Component {
  render() {
    return (
      <div
        className={componentStyle["container"]}
        style={{
          visibility: this.props.showNext ? "visible" : "hidden",
        }}
      >
        <div className={componentStyle["core-type"]}>
          <div
            className={`${componentStyle["font"]} ${componentStyle["single-core-font"]}`}
          >
            <div></div>
            <div>单芯线缆</div>
          </div>
          <div
            className={`${componentStyle["back"]} ${componentStyle["single-core-back"]}`}
          ></div>
        </div>
        <div className={componentStyle["core-type"]}>
          <div
            className={`${componentStyle["font"]} ${componentStyle["double-core-font"]}`}
          >
            <div></div>
            <div>双芯线缆</div>
          </div>
          <div
            className={`${componentStyle["back"]} ${componentStyle["double-core-back"]}`}
          ></div>
        </div>
      </div>
    );
  }
}
